var numRescueBoats = function(people, limit) {
  people.sort((a,b) => a-b);

  let boats = 0, lighterIdx = 0, heavierIdx = people.length - 1;
  while (lighterIdx < heavierIdx +1) {
    const lighter = people[lighterIdx], heavier = people[heavierIdx];

    heavierIdx--;
    boats++;
    if (lighter + heavier <= limit) {
      lighterIdx++;
    }
  }
  return boats;
}

/**
 * @param {number[]} people
 * @param {number} limit
 * @return {number}
 */
var _numRescueBoats = function(people, limit) {
  people.sort((a,b) => b-a);
  
  let boats = 0;
  while(people.length > 0) {
    const first = people.shift();
    if (first >= limit) {
      boats++;
      continue;
    } else if (!people.length) {
      boats++;
      break;
    }
    const limitLeft = limit - first;
    const secondIdx = findNearestSmaller(people, limitLeft);
    // const secondIdx = people.findIndex(p => first + p <= limit);
    boats++;
    if (secondIdx >= 0)
      people.splice(secondIdx, 1);
  }

  return boats;
};

const findNearestSmaller = function (items, target) {
  let low = 0, high = items.length - 1;
  while (low <= high) {
    const mid = low + Math.floor((high - low) / 2);
    if (items[mid] === target) {
      return mid;
    } else if (items[mid] < target) {
      high = mid - 1;
    } else {
      low = mid + 1;
    }
  }

  if (low < 0 || low >= items.length) return high;
  if (high < 0 || high >= items.length) return low;

  const result = items[low] < target ? low : high;
  return result;
}

